import React, { Component } from "react";
import cateimg from "../images/cateimg.png";
export default class Featured extends Component {
  render() {
    return (
      <div>
        <div class="m-auto text-center pt-5 pb-5">
          <h2>Featured</h2>
        </div>
        <div class="container">
          <div
            style={{
              display: "flex",
              justifyContent: "space-between",
            }}
          >
            <div style={{ display: "flex" }}>
              <div style={{ width: "330px", height: "355px" }}>
                <img
                  src={cateimg}
                  alt="..."
                  style={{
                    borderRadius: "10px",
                    height: "57vh",
                    width: "100%",
                    borderBottomRightRadius: "0",
                  }}
                />
              </div>
              <div style={{ width: "30%", alignSelf: "flex-end " }}>
                <p class="text-center" style={{ marginBottom: "0px" }}>
                  Product Name
                </p>
                <p class="text-center">Category</p>
                <div
                  style={{
                    width: "200px",
                    backgroundColor: "red",
                    height: "55px",
                    borderRadius: "10px",
                    borderBottomLeftRadius: "0",
                    borderTopLeftRadius: "0",
                  }}
                >
                  <p
                    style={{
                      textAlign: "center",
                      lineHeight: "60px",
                      color: "white",
                    }}
                  >
                    <span>Price</span>
                    <span class="pl-3">$120</span>
                  </p>
                </div>
              </div>
            </div>
            <div style={{ display: "flex" }}>
              <div style={{ width: "320px", height: "355px" }}>
                <img
                  src={cateimg}
                  alt="..."
                  style={{
                    borderRadius: "10px",
                    height: "57vh",
                    width: "100%",
                    borderBottomRightRadius: "0",
                  }}
                />
              </div>
              <div style={{ width: "30%", alignSelf: "flex-end " }}>
                <p class="text-center" style={{ marginBottom: "0px" }}>
                  Product Name
                </p>
                <p class="text-center">Category</p>
                <div
                  style={{
                    width: "200px",
                    backgroundColor: "red",
                    height: "55px",
                    borderRadius: "10px",
                    borderBottomLeftRadius: "0",
                    borderTopLeftRadius: "0",
                  }}
                >
                  <p
                    style={{
                      textAlign: "center",
                      lineHeight: "60px",
                      color: "white",
                    }}
                  >
                    <span>Price</span>
                    <span class="pl-3">$120</span>
                  </p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
